import Grid from '@mui/material/Grid';
import React from 'react'

export default function Center(props) {
  return (
      <Paper>
          <Grid
              container
              spacing={3}
              direction={'column'}
              justify={'center'}
              alignItems={'center'}
          >
              <Grid item sx={1}>
                  { props.children}
              </Grid>
          </Grid>
      </Paper>
  )
}
